import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    '& .MuiTextField-root': {
      margin: theme.spacing(1),
      width: 200,
    },
  },
}));

const Search = () => {

  const getLocation = (e) =>{
    console.warn(e.target.value)
  }


   return (<div> 
     
     <Grid item sm="4"
      container
      direction="row"
      justify="center"
      alignItems="center"
     >
       
     <TextField
     fullWidth
     size= "Normal"
    label="Enter Location"
   onChange={getLocation}
    />
     </Grid>
     
    </div>  );
}
 
export default Search;
